    ApproveSpendPlanComponent.prototype.autoSizeCols = function (skipHeader) {
        var allColumnIds = [];
        this.gridColumnApi.getAllColumns().forEach(function (column) {
            allColumnIds.push(column.colId);
        });
        this.gridColumnApi.autoSizeColumns(allColumnIds, skipHeader);
    };
    ApproveSpendPlanComponent.prototype.isUserAdmin = function () {
        return this.roleList === "ROLE_ADMIN" ? true : false;
    };
    ApproveSpendPlanComponent.prototype.changeStatus = function () {
    };
    ApproveSpendPlanComponent.prototype.submitChangeStatus = function () {
        console.log("this.changeStatusForm.controls.action.value", this.changeStatusForm.controls.action.value);
        if (this.changeStatusForm.controls.action.value === "Reject") {
            this.changeStatusMessage = "The following changes have been rejected";
        }
        else {
            this.saveSuccess = true;
            this.changeStatusMessage = "The status changes have been saved and submitted";
        }
    };
    ApproveSpendPlanComponent.prototype.onActionChange = function (e) {
        console.log("action", e.target.value);
    };
    ApproveSpendPlanComponent.prototype.currencyFormatter = function (params) {
        return "\x24" + this.formatNumber(params.value);
    };
    ApproveSpendPlanComponent.prototype.formatNumber = function (number) {
        return Math.floor(number)
            .toString()
            .replace(/(\d)(?=(\d{3})+(?!\d))/g, "$1,");
    };
    ApproveSpendPlanComponent.prototype.formatDecimal = function (number) {
        console.log(number.value, 'number');
        return number.value !== null ? Math.floor(number.value) : '';
    };
    ApproveSpendPlanComponent.prototype.bracketsFormatter = function (params) {
        var i = Math.floor(params.value).toString();
        if (i !== null && i[0] === '-') {
            return i[0] !== '-' ? this.formatNumber(i) : "($" + i.substr(1) + ")";
        }
        else {
            return i === null ? '' : '$' + i;
        }
    };
    ApproveSpendPlanComponent.prototype.onGridReady = function (params) {
        this.gridApi = params.api;
        this.gridColumnApi = params.columnApi;
        params.api.sizeColumnsToFit();
    };
