    SubmitPlanComponent.prototype.autoSizeCols = function (skipHeader) {
        var allColumnIds = [];
        this.gridColumnApi.getAllColumns().forEach(function (column) {
            allColumnIds.push(column.colId);
        });
        this.gridColumnApi.autoSizeColumns(allColumnIds, skipHeader);
    };
    SubmitPlanComponent.prototype.onGridReady = function (params) {
        this.gridApi = params.api;
        this.gridColumnApi = params.columnApi;
        params.api.sizeColumnsToFit();
    };
    SubmitPlanComponent.prototype.openSubmitDialog = function () { };
    SubmitPlanComponent.prototype.onOfficeChangeEvent = function (event) {
        this.officeName = event.target.value;
        this.officeCtp = this.officeName.slice(3);
    };
    SubmitPlanComponent.prototype.submitChangeStatus = function () {
        if (this.SubmitChangeForm.controls.action.value === "Reject") {
            this.submitChangesMessage = "Your Change Request have been dismissed";
        }
        else {
            this.submitChangesMessage = "Your Change Request have been submitted for approval";
        }
    };
