    SubmitPlanComponent.prototype.currencyFormatter = function (params) {
        return "\x24" + this.formatNumber(params.value);
    };
    SubmitPlanComponent.prototype.formatNumber = function (number) {
        return Math.floor(number)
            .toString()
            .replace(/(\d)(?=(\d{3})+(?!\d))/g, "$1,");
    };
    SubmitPlanComponent.prototype.formatDecimal = function (number) {
        var i = number.value;
        if (i !== null && i !== undefined) {
            return Math.floor(i);
        }
        else if (i === null) {
            return '';
        }
        // return number.value !== null ? Math.floor(number.value) : '';
    };
    SubmitPlanComponent.prototype.bracketsFormatter = function (params) {
        var i = Math.floor(params.value).toString();
        if (i !== null && i[0] === '-') {
            return i[0] !== '-' ? this.formatNumber(i) : "($" + i.substr(1) + ")";
        }
        else {
            return i === null ? '' : '$' + i;
        }
    };
